import ImageBox from "./ImageBox";

function BigHeading(){
    return(
        <div>
            <ImageBox 
                PictureSource="/Applications/Sandali/DietitianWebsite/client/public/Maam3.gif" 
                PictureAlternateText="ProfilePicture"
            />
            <div className="container" >
                <h1 className="BigHeadingFont">
                    Hi! I'm Rashu <br></br>
                    and I'm a Certified <br></br>
                    Health Nutritionist
                </h1>
            </div>
        </div>
    );
}

export default BigHeading;
